import reactDom from "react-dom";
import Auction from "../route/Auction";
import React from "react";

const AppRouter = () => {
    return (
        <Router>
            <Route path='/auction'>
                <Auction />
            </Route>
        </Router>
    )
}

export default AppRouter;
